import classes from "./Navbar.module.css";

function Navbar() {
  return (
    <>
      <nav className={classes.navbar}>
        <div>
          <span className={classes.navlink}>InfoObjects</span>
          <span className={classes.navlink}>Admin</span>
          <span className={classes.navlink}>Products</span>
        </div>
        <div>
          <span className={classes.logout}>Logout</span>
        </div>
      </nav>
    </>
  );
}

export default Navbar;
